  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0115154 includes chemical,
  discrete sample, physical and profile data collected from AURORA AUSTRALIS in the
  Great Australian Bight and Indian Ocean from 1998-02-28 to 1998-04-01 and retrieved
  during cruise AA9706. These data include ALKALINITY, DELTA CARBON-13, DISSOLVED
  INORGANIC CARBON, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, PHOSPHATE, SALINITY,
  SILICATE and WATER TEMPERATURE. The instruments used to collect these data include
  CTD and bottle. These data were collected by Mark Rosenberg of Antarctic Climate
  & Ecosystems Cooperative Research Centre, Bronte Tilbrook of Commonwealth Scientific
  and Industrial Research Organization and Benjamin McNeil of UNSW Climate Change
  Research Centre as part of the WOCE_SR03_1998 data set.nnThe World Ocean Circulation
  Experiment (WOCE) was a major component of the World Climate Research Program with
  the overall goal of better understanding the ocean's role in climate and climatic
  changes resulting from both natural and anthropogenic causes. The CO2 survey took
  advantage of the sampling opportunities provided by the WOCE Hydrographic Program
  (WHP) cruises during this period between 1990 and 1998. The final collection covers
  approximately 23,000 stations from 94 WOCE cruises.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
